    d2l_extra_reg_re = 1'b0;
    
    casez(pio_dec_address_d1)
    //  Register: stats.disable_check_0     Address: 0x1000     External: false
    13'b0010000000000:
      begin
        d2l_stats_disable_check_0_we = pio_write_active & ~dec_pio_ack;
