      end
    //  Register: stats.log_address1     Address: 0x1104     External: false
    13'b0010001000001:
      begin
        d2l_stats_log_address1_we = pio_write_active & ~dec_pio_ack;
        d2l_stats_log_address1_re = pio_read_active & ~dec_pio_ack;
